import React from 'react'
import Dice from './Dice'

const DiceList = ({diceData}) => {
  return (
    <div className='diceList'>
            {diceData.map(dice =>(
                    <Dice
                        name={dice.key}
                        image={dice.key}
                    />             
            ))}
        </div>
  )
}

export default DiceList
